// Hair by AMR - React App with Modern Hero Banner

import React from 'react';
import Navbar from './navbar';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import {
  BeakerIcon,
  ScissorsIcon,
  ShoppingCartIcon
} from '@heroicons/react/24/solid';

function Home() {
  return (
    <div>
      {/* Modern Hero Banner */}
      <section className="relative bg-gray-900 text-white flex items-center justify-center h-[80vh] overflow-hidden">
        <img
          src="/images/hero-bg.jpg"
          alt="Rugged background"
          className="absolute inset-0 w-full h-full object-cover opacity-30"
        />
        <div className="relative z-10 text-center px-6 md:px-0">
          <h1 className="font-bold text-3xl md:text-5xl tracking-tight mb-4 uppercase">
            Master Your Look
          </h1>
          <p className="max-w-xl mx-auto text-lg md:text-2xl mb-8">
            Discover high-quality hair systems and grooming essentials built for men who want to stand out.
          </p>
          <Link
            to="/shop"
            className="inline-block bg-white text-gray-900 font-semibold py-3 px-8 rounded-full shadow-lg hover:bg-gray-100 transition"
          >
            Shop Now
          </Link>
        </div>
      </section>

      {/* Three-Step Process */}
      <section className="bg-white text-black py-24 px-6 md:px-16 text-center">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {[BeakerIcon, ScissorsIcon, ShoppingCartIcon].map((Icon, i) => {
            const titles = [
              '1. Pick Your Hair Color',
              '2. Get a Template Cut',
              '3. Order a Starter Kit'
            ];
            const texts = [
              'Select the shade that best matches your natural hair.',
              'Send us your head measurements using our instructions.',
              'Receive your unit and start your hair journey!'
            ];
            return (
              <div
                key={i}
                className="p-6 border rounded-lg shadow-lg flex flex-col items-center"
              >
                <Icon className="h-12 w-12 text-black fill-current mb-4" />
                <h3 className="text-xl md:text-2xl font-semibold mb-3 uppercase">
                  {titles[i]}
                </h3>
                <p>{texts[i]}</p>
              </div>
            );
          })}
        </div>
      </section>
    </div>
  );
}

function Shop()       { return <div className="p-6">Shop Page</div>; }
function ColorChart() { return <div className="p-6">Hair Color Chart Page</div>; }
function Supplies()   { return <div className="p-6">Supply Page</div>; }
function About()      { return <div className="p-6">About Me Page</div>; }
function FAQ()        { return <div className="p-6">FAQ Page</div>; }
function Contact() {
  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Contact Us</h2>
      <form className="grid grid-cols-1 gap-4 max-w-lg">
        <input className="border p-2" type="text" placeholder="Name" required />
        <input className="border p-2" type="email" placeholder="Email" required />
        <textarea className="border p-2" rows="4" placeholder="Message" required />
        <button type="submit" className="bg-black text-white p-2 rounded">Send</button>
      </form>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/shop" element={<Shop />} />
        <Route path="/color-chart" element={<ColorChart />} />
        <Route path="/supplies" element={<Supplies />} />
        <Route path="/about" element={<About />} />
        <Route path="/faq" element={<FAQ />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}

export default App;
